        "<a href=\"https://colab.research.google.com/github/jairft12-bot/quejas/blob/main/jair.py\" target=\"_parent\"><img src=\"https://colab.research.google.com/assets/colab-badge.svg\" alt=\"Open In Colab\"/></a>"
